import HomeScreen from './screens/HomeScreen';
import Homesearch from './components/HomeSearch';
import Des from './components/HomeSearch';

export default function App() {
  return (
    <View style={styles.container}>
     <ScrollView>
      <StatusBar style="auto" />

      <HomeScreen/>
      <Homesearch/>
      </ScrollView>
    </View>
  );
}

